"""
Given a string, sort it in decreasing order based on the frequency of characters.

Example 1:

Input:
"tree"

Output:
"eert"

Explanation:
'e' appears twice while 'r' and 't' both appear once.
So 'e' must appear before both 'r' and 't'. Therefore "eetr" is also a valid answer.
Example 2:

Input:
"cccaaa"

Output:
"cccaaa"

Explanation:
Both 'c' and 'a' appear three times, so "aaaccc" is also a valid answer.
Note that "cacaca" is incorrect, as the same characters must be together.
Example 3:

Input:
"Aabb"

Output:
"bbAa"

Explanation:
"bbaA" is also a valid answer, but "Aabb" is incorrect.
Note that 'A' and 'a' are treated as two different characters.
"""
from collections import Counter
class Solution_1:
    def frequencySort(self, s):
        """
        :type s: str
        :rtype: str
        """
        s_counter = Counter(s)
        # print(s_counter)
        s_value_dict = dict()
        res = ''
        for key,value in s_counter.items():
            s_value_dict[value] = s_value_dict.get(value, '') + key
        for key in sorted(s_value_dict.keys(), reverse = True):
            for letter in s_value_dict[key]:
                res += key * letter
        return res

class Solution:
    def frequencySort(self, s):
        """
        :type s: str
        :rtype: str
        """
        if len(s) < 2:
            return s
        s_counter = Counter(s)
        pairs = [(v,k) for k,v in s_counter.items()]
        pairs = sorted(pairs,reverse = True)
        res = [pair[1]*pair[0] for pair in pairs]
        return ''.join(res)



s = Solution()
test = "tree"
print(s.frequencySort(test))
test = "cccaaa"
print(s.frequencySort(test))
test = "Aabb"
print(s.frequencySort(test))
test = ""
print(s.frequencySort(test))
